@prefix dcterms: <http://purl.org/dc/terms/> .
@prefix fcaont: <https://growgraph.dev/fcaont#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix schema: <https://schema.org/> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

fcaont:Conviction a rdfs:Class ;
    rdfs:label "Conviction" ;
    rdfs:comment "Legal decision regarding guilt of an accused individual." .

fcaont:Fact a rdfs:Class ;
    rdfs:label "Fact" ;
    rdfs:comment "A fact related to an event or offence in criminal cases." .

fcaont:MaritalStatus a rdfs:Class ;
    rdfs:label "Marital Status" ;
    rdfs:comment "Marital status of a person, e.g., single, married, divorced, pacs, widowed." ;
    owl:oneOf ( fcaont:Single fcaont:Married fcaont:Divorced fcaont:Pacs fcaont:Widowed ) .

fcaont:Offence a rdfs:Class ;
    rdfs:label "Offence" ;
    rdfs:comment "An act or omission which constitutes a criminal wrongdoing." ;
    rdfs:subClassOf schema:Event .

schema:Event a rdfs:Class .

schema:Organization a rdfs:Class .

schema:Person a rdfs:Class .

fcaont: a owl:Ontology ;
    rdfs:label "French (Supreme) Court of Appeal Ontology" ;
    dcterms:created "2024-12-18" ;
    dcterms:description "This ontology represents the legal concepts and relationships relevant to the French Supreme Court of Appeal. It includes classes for convictions, offences, facts, and personal attributes such as marital status and profession. The ontology aims to facilitate the organization and retrieval of legal information in a structured manner." ;
    dcterms:identifier "hash:637613391e33483a60f539caf4b732d80fbcb6fb5a9bce6e5042713d156498c1" ;
    dcterms:license "https://creativecommons.org/licenses/by/4.0/" ;
    dcterms:title "fcaont" ;
    rdfs:comment "This ontology represents the legal concepts and relationships relevant to the French Supreme Court of Appeal. It includes classes for convictions, offences, facts, and personal attributes such as marital status and profession. The ontology aims to facilitate the organization and retrieval of legal information in a structured manner." ;
    owl:versionInfo "3.0.0" .

fcaont:Age a rdf:Property ;
    rdfs:label "age" ;
    rdfs:comment "The age of a person in years. Must be a non-negative integer." ;
    rdfs:domain schema:Person ;
    rdfs:range xsd:nonNegativeInteger ;
    schema:unitCode "ANN"^^xsd:string .

fcaont:concerns a rdf:Property ;
    rdfs:label "concerns" ;
    rdfs:comment "Describes the involvement of an event in another event or issue." ;
    rdfs:domain schema:Event ;
    rdfs:range schema:Event .

fcaont:contains a rdf:Property ;
    rdfs:label "contains" ;
    rdfs:comment "Denotes events or facts involved in a related event." ;
    rdfs:domain schema:Event ;
    rdfs:range schema:Event .

fcaont:hasConviction a rdf:Property ;
    rdfs:label "hasConviction" ;
    rdfs:comment "Indicates a personâs conviction." ;
    rdfs:domain schema:Person ;
    rdfs:range fcaont:Conviction .

fcaont:hasFact a rdf:Property ;
    rdfs:label "hasFact" ;
    rdfs:comment "Indicates a fact associated with an event." ;
    rdfs:domain schema:Event ;
    rdfs:range fcaont:Fact .

fcaont:hasMaritalStatus a rdf:Property ;
    rdfs:label "hasMaritalStatus" ;
    rdfs:comment "Indicates the marital status of a person." ;
    rdfs:domain schema:Person ;
    rdfs:range fcaont:MaritalStatus .

fcaont:hasOffenseType a rdf:Property ;
    rdfs:label "has Offense Type" ;
    rdfs:comment "Relates an offense to its offense type." ;
    rdfs:domain fcaont:Offence ;
    rdfs:range fcaont:OffenseType .

fcaont:hasProfession a rdf:Property ;
    rdfs:label "hasProfession" ;
    rdfs:comment "Indicates the profession of a person." ;
    rdfs:domain schema:Person ;
    rdfs:range schema:Occupation .

fcaont:hasPunishment a rdf:Property ;
    rdfs:label "hasPunishment" ;
    rdfs:comment "Indicates a punishment related to a conviction." ;
    rdfs:domain fcaont:Conviction ;
    rdfs:range fcaont:Punishment .

fcaont:initiates a rdf:Property ;
    rdfs:label "initiates" ;
    rdfs:comment "Describes the initiation of an event by a person." ;
    rdfs:domain schema:Person ;
    rdfs:range schema:Event .

fcaont:isAssociatedWith a rdf:Property ;
    rdfs:label "isAssociatedWith" ;
    rdfs:comment "Associates a conviction with an offence." ;
    rdfs:domain fcaont:Conviction ;
    rdfs:range fcaont:Offence .

fcaont:issues a rdf:Property ;
    rdfs:label "issues" ;
    rdfs:comment "Indicates that an organization issues or triggers an event." ;
    rdfs:domain schema:Organization ;
    rdfs:range schema:Event .

fcaont:knows a rdf:Property ;
    rdfs:label "knows" ;
    rdfs:comment "Indicates acquaintance or relation between two persons." ;
    rdfs:domain schema:Person ;
    rdfs:range schema:Person .

fcaont:prosecutes a rdf:Property ;
    rdfs:label "prosecutes" ;
    rdfs:comment "Indicates that a person is prosecuting an event." ;
    rdfs:domain schema:Person ;
    rdfs:range schema:Event .

fcaont:residesAt a rdf:Property ;
    rdfs:label "residesAt" ;
    rdfs:comment "Indicates the residence of a person." ;
    rdfs:domain schema:Person ;
    rdfs:range schema:Place .

fcaont:takesPlaceOn a rdf:Property ;
    rdfs:label "takesPlaceOn" ;
    rdfs:comment "Specifies the date on which an event occurs." ;
    rdfs:domain schema:Event ;
    rdfs:range schema:Date .

fcaont:Divorced a fcaont:MaritalStatus ;
    rdfs:label "Divorced" ;
    rdfs:comment "Person is legally divorced." .

fcaont:Married a fcaont:MaritalStatus ;
    rdfs:label "Married" ;
    rdfs:comment "Person is legally married." .

fcaont:Pacs a fcaont:MaritalStatus ;
    rdfs:label "PACS" ;
    rdfs:comment "Person is in a French civil partnership (PACS)." .

fcaont:Single a fcaont:MaritalStatus ;
    rdfs:label "Single" ;
    rdfs:comment "Person is not married or in a legal partnership." .

fcaont:Widowed a fcaont:MaritalStatus ;
    rdfs:label "Widowed" ;
    rdfs:comment "Person's spouse has passed away." .
